L["Enhanced filtering and sorting Desc"] = "Фильтрация и сортировка достижений улучшены благодаря следующим функциям. Категории: |T:1:8|t - {mergeSmallCategories}: Объединяйте категории, если разрешено, с достижениями, меньшими, чем {mergeSmallCategoriesNumber} (1). Фильтрация (можно выбрать несколько фильтров одновременно): |T:1:8|t - {completed}: Показать завершенные достижения. |T:1:8|t - {notCompleted}: Показать незавершенные достижения. |T:1:8|t - {obtainable}: Показать достижимые достижения. |T:1:8|t - {notObtainable}: Показывать недостижимые достижения. |T:1:8|t - {faction} ({resetFactionFilters} {resetFactionFiltersEnabled}) (2) |T:1:8|t|T:1:8|t -  {neutral}: Показывает достижения, которые могут заработать как {alliance_wc}, так и {horde_wc}. |T:1:8|t|T:1:8|t - {alliance}: Показывать достижения, которые может заработать только {alliance_wc}. |T:1:8|t|T:1:8|t - {horde}: Показывать достижения, которые может заработать только {horde_wc}. |T:1:8|t - {excluded}: Показывать исключенные достижения. |T:1:8/t - {collapseChain}: Показывать только последнее завершенное и первое незавершенное достижение в цепочке. Сортировка: |T:1:8|t - {noSorting}: Сортировка не применяется. |T:1:8|t - {sortByName}: Сортировать достижения на основе их названий. |T:1:8|t - {sortByCompletion}: Сортировка достижений в зависимости от того, завершены они или нет. |T:1:8|t - {sortByID}: Сортировка достижений на основе их идентификатора. |T:1:8|t - {reverseSort}: Если выбрано это значение, измените порядок отсортированных достижений.  {tabs}: |T:1:8|t - Они обладают всеми функциями фильтрации и сортировки, упомянутыми выше, но могут быть изменены независимо от других. |T:1:8|t - Изменение любого из вышеперечисленных фильтров перезапишет фильтрацию и сортировку отдельной вкладки. {specialCategories}: |T:1:8|t - Они обладают всеми функциями фильтрации и сортировки, упомянутыми выше, но могут быть изменены независимо от других. {earnedBy} (смотрите {earnedByTutorial} для получения более подробной информации)  |T:1:8|t- {account}: Достижения начисляются, если они заработаны на любом персонаже в вашем аккаунте.  |T:1:8|t- {character}: Достижения сохраняются, если они получены вашим текущим персонажем, и частично сохраняются, если они получены другим персонажем в вашей учетной записи, но не текущим. Другое:  |T:1:8|t- {help}: Запустите учебник с самого начала и сбросьте то, что вы просмотрели.  |T:1:8|t|T:1:8|t - Показывает конкретную страницу руководства без сброса того, что вы просмотрели.  |T:1:8|t- {options}: Откройте параметры дополнения (2). Дополнительные фильтры и параметры сортировки можно запросить на {discord} или {CurseForge} (ссылки в настройках). (1) Параметры можно найти в разделе {gameMenu} {arrow} {interface} {arrow} {addOns} {arrow} {addonName} {arrow} {layout} {arrow} {categories} (2) Параметры можно найти в разделе {gameMenu} {arrow} {interface} {arrow} {addOns} {arrow} {addonName}"
