L["Enhanced tooltip Achievements Desc"] = "Каждая всплывающая подсказка содержит дополнительную информацию о том, как достижения связаны друг с другом (если они связаны). В нее добавлено несколько новых разделов. Особенности:  |T:1:8|t - {notObtainable}: Показывает текст \"{Больше недоступно}\", если достижение больше недоступно.  |T:1:8|t - {earnedBy}: Смотрите {earnedBy} для получения дополнительной информации.  |T:1:8|t - {partOfAChain}: Показывает список достижений, частью которых является зависшее достижение (1) ({partOfAChainEnabled}) (2).  |T:1:8|t - {requiredFor}: Показывает список достижений, для получения которых требуется выполнение зависшего достижения (1) ({requiredForEnabled}) (2).  |T:1:8|t - {otherFaction}: Показывает соответствующее достижение другой фракции ({otherFactionEnabled}) (2).  |T:1:8|t - {objectivesProgress}: Показывает список целей с прогрессом ({objectivesProgressEnabled}) (2).  |T:1:8|t|T:1:8|t - Пользовательские цели: Некоторые достижения имеют пользовательские цели, такие как достижения трансмога, показывающие ваш прогресс в достижении соответствующих наборов трансмога. Значки:  |T:1:8|t - {ready}: Достижение завершено.  |T:1:8|t -  {waiting}: Достижение не завершено.  |T:1:8|t -  {notready}: Достижение больше невозможно получить. Цвета:  |T:1:8|t - {green}: Достижение/цель выполнено.  |T:1:8|t - {grey}: Достижение/цель не завершена.  |T:1:8|t - {red}: Достижение больше невозможно получить.  |T:1:8|t - Светлее {lightGreen}, {lightGrey} или {lightRed}: Зависшее достижение. Дополнительные пользовательские цели можно запросить в {discord} или {CurseForge} (ссылки в настройках). (1) При необходимости в каждой строке могут отображаться два значка. Первый значок используется по умолчанию, второй предназначен для текущего символа ({currentCharacterIconEnabled}) (2). (2) Опции можно найти в разделе {gameMenu} {arrow} {interface} {arrow} {addOns} {arrow} {addonName} {arrow} {layout} {arrow} {achievements}"
L["Enhanced tooltip Categories Desc"] = "Каждая всплывающая подсказка содержит дополнительную информацию о том, сколько достижений (недоступно) доступно и (не) завершено. Цифры на индикаторе выполнения представлены в следующем формате:  |T:1:8|tO C (+NONC) / T  |T:1:8|t|T:1:8|t - {oc}: (недостижимые) завершенные достижения.  |T:1:8|t|T:1:8|t - {nonc}: Недостижимые незавершенные достижения (1).  |T:1:8|t|T:1:8|t - T: Общее количество достижений. Цвета:  |T:1:8|t - {green}: (недоступные) завершенные достижения.  |T:1:8|t - {red}: Недоступные незавершенные достижения (1).  |T:1:8|t - Пусто: доступные незавершенные достижения. {red} часть индикатора выполнения и число в скобках можно отключить либо в параметрах ({showNotObtainable}) (1), либо сняв флажок с фильтра {notObtainable}. (1) Параметры можно найти в разделе {gameMenu} {arrow} {interface} {arrow} {addOns} {arrow} {addonName} {arrow} {layout} {arrow} {categories}"
